import React from "react";
import "./ProjectTemplate.css";

function ProjectTemplate() {
  return (
    <div className="Project">
      <div className="ProjectBox">
        <img className="projectPicture" src={props.picture}></img>
        <div className="projectDatas">
          <div>
            <h1 className="projectName">Projekt neve</h1>
            <div className="projectDescription">
              <p>szoszi</p>
            </div>
            <p className="projectTechnologies">használt technológiák</p>
            <p className="projectLinks">esetleg majd linkek</p>
          </div>
        </div>
      </div>
    </div>
  );
}

export default ProjectTemplate;
